import React from 'react';

const SignInForm = () => {
	return (
		<nav style = {{ display : 'flex' , justifyContent: 'flex-end' }} >
			<p className = 'f3 link dim black underline pa3 pointer'>
			Sign Out </p>
		</nav>
		);
}

export default SignInForm;
